import React,{Component} from 'react'

export default class Bio extends Component{
  render(){
    return(
      <div className="bio">
        <h4>About:</h4>
        <p>
        Full stack web developer with a passion for personal growth.  Experience developing apps with Ruby on Rails, JavaScript, and React, and a background in customer service.  I discovered web development through hobbyist programming and creating programs to automate tasks in my previous jobs and everyday life. I bring strong skills in problem solving, individually and as a team, helping forward looking companies to succeed.  Other interests include foreign languages, rock climbing, MMA, and soccer.
        </p>
      </div>
    )
  }
}
